ControlPropertyState.AutoRuleBindingString:
With(
    {
        screen: Self.BugReportScreen.Name,
        outName: Concatenate(ScreenName,"_",Text(Now())),
        desc: BugDescription
    },
    Patch(
        'Mileage Reimbursement Bug Report',
        Defaults('Mileage Reimbursement Bug Report'),
        {
            'Screen Shot': {
                FileName: outName,
                Value: PDF(
                    App.ActiveScreen,
                    {
                        DPI: 24,
                        Orientation: PaperOrientation.Landscape
                    }
                )
            },
            'Bug Description': desc,
            Name: outName,
            Screen: App.ActiveScreen.Name,
            'Status Reason': First(Choices('Status Reason (Mileage Reimbursement Bug Report)')).Value
        }
    )
)

